CREATE TABLE tfm.establecimiento (
	id varchar(7) NOT NULL,
	departamento_id varchar(10) NULL,
	departamento varchar(200) NULL,
	distrito_id varchar(10) NULL,
	distrito varchar(200) NULL,
	barrio_id int4 NULL,
	barrio varchar(200) NULL,
	zona_id varchar(10) NULL,
	zona varchar(200) NULL,
	direccion varchar(500) NULL,
	latitud_grados varchar(20) NULL,
	longitud_grados varchar(20) NULL,
	latitud numeric NULL,
	longitud numeric NULL,
	CONSTRAINT establecimiento_pkey PRIMARY KEY (id)
);


CREATE TABLE tfm.e (
	nro int4 NOT NULL,
	lat numeric NULL,
	long numeric NULL,
	id varchar NULL,
	CONSTRAINT "E_pkey" PRIMARY KEY (nro)
);


-- tfm.e foreign keys

ALTER TABLE tfm.e ADD CONSTRAINT "none" FOREIGN KEY (id) REFERENCES tfm.establecimiento(id);



CREATE TABLE tfm.d (
	nro int4 NOT NULL,
	lat numeric NULL,
	long numeric NULL,
	CONSTRAINT d_pkey PRIMARY KEY (nro)
);



CREATE TABLE tfm.c (
	nro int4 NOT NULL,
	g int4 NULL,
	t int4 NULL,
	s char NULL,
	i int4 NULL,
	e int4 NULL,
	CONSTRAINT c_pkey PRIMARY KEY (nro)
);
CREATE INDEX fki_fk1_c ON c USING btree (e);


-- tfm.c foreign keys

ALTER TABLE tfm.c ADD CONSTRAINT fk1_c FOREIGN KEY (e) REFERENCES tfm.e(nro);


